import * as React from 'react';
import { Pokedex } from './components/Pokedex.jsx'
import translate from 'translate-google-api';

export default  function App() {



  const result =  translate(`I'm fine.`, {
    tld: "cn",
    to: "vi",
  });

  return (
    <>
      <Pokedex />
    </>
  )
}
